import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import { Link } from "react-router-dom";

const MealSearch = ({meals}) => {
    return(
        <Container>
            <Row className="my-3">
            {
                (category && category.length >=1) ? category.map((cat)=>{
                    return(
                        <Col xs={6} sm={6} md={4} lg={3} className="my-1">
                            <Link to={`/category/meal/${cat.idMeal}`}>
                            <div className="card" >
                                    <img src= {cat.strMealThumb} className="card__image" alt="hu"/>
                                    <div className="CardCategor">
                                        <div className="w-100 p-2">
                                            <p className="CategoryName">{cat.strMeal}</p>
                                        </div>
                                    </div>
                            </div>
                            </Link>
                        </Col>
                    )
                }): <h1>No Meals Found</h1>
            }
        
        </Row>
        </Container>
    )
}
export default MealSearch
